const DataEngineeringContainer = () => {
  return (
    <div className="relative w-[1587px] h-[500px] text-left text-29xl text-black font-poppins">
      <div className="absolute top-[0px] left-[-2.54px] bg-white w-[1590px] h-[500px]" />
      <img
        className="absolute top-[37px] left-[199.46px] rounded-6xl w-[547px] h-[423px] object-cover"
        alt=""
        src="/26@2x.png"
      />
      <div className="absolute top-[140px] left-[770.46px] w-[597px] flex flex-col items-start justify-start">
        <div className="relative tracking-[0.01em] leading-[160%] font-semibold inline-block w-[597px] h-[173px] shrink-0">
          Data engineering lies at the heart of our mission
        </div>
        <div className="rounded-3xs bg-deeppink w-[133px] h-9 flex flex-col items-center justify-center text-center text-base text-white">
          <i className="relative leading-[105.9%] inline-block w-[101px] h-3.5 shrink-0">
            Read More ...
          </i>
        </div>
      </div>
    </div>
  );
};

export default DataEngineeringContainer;
